District 9 (2009) 

Zuid-Afrika / Nieuw-Zeeland
Science-Fiction
112 minuten

geregisseerd door Neill Blomkamp
met William Allen Young, Robert Hobbs en Sharlto Copley

Het verhaal over een fictionele wereld waarin onze Aarde door buitenaardsen is gevonden. Echter de mensheid heeft dit buitenaardse ras als tweederangsburgers ondergebracht in getto's in Zuid-Afrika. Ze krijgen steun van een overheidsfunctionaris wanneer deze hun biotechnologie ontdekt.

Vanaf 8 oktober in de bioscoop

